cssAnimations:
@keyframes scroll { 
  0% { transform: translateX(0px); }
  100% { transform: translateX(-100%); }
}

@keyframes slide-to-left { 
  100% { transform: translateX(-50%); }
}

@keyframes fadeIn { 
  0% { opacity: 0; }
  100% { opacity: 1; }
}

@media only screen and (max-width: 767px) {
  .pd-top .bdr-container { padding-top: 70px; }
  .main-banner .text { left: 40px; right: 40px; }
  .podcast-new .main-image { margin-bottom: 26px; }
