@media (prefers-reduced-motion: no-preference) {
  .App-logo { animation: 20s linear 0s infinite normal none running App-logo-spin; }
}

@keyframes App-logo-spin { 
  0% { transform: rotate(0deg); }
  100% { transform: rotate(1turn); }
}
